script: |
  super -f text -I q2696.spq | sort > q2696.out

inputs:
  - name: q2696.spq
    data: |
      SELECT DISTINCT - - ( ( - col0 ) ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( col2 * col1 / - 98, col2 + + 55 * - 96 );
  - name: tab2

outputs:
  - name: q2696.out
    data: |
      -46
      -64
      -75
